import SkillCard from "./card";
import { Code, Server, Palette, Database } from "lucide-react";
import "./skills.css";

const Skills = () => {
  return (
    <section className="skills-section">
      <h3 >Skills & Expertise</h3>

      <div className="skills-grid">
        <SkillCard
          icon={<Code size={32} />}
          title="Frontend Development"
          description="React, TypeScript, Tailwind CSS, Next.js, Vue.js"
        />

        <SkillCard
          icon={<Server size={32} />}
          title="Backend Development"
          description="Node.js, Python, PostgreSQL, MongoDB, REST APIs"
        />

        <SkillCard
          icon={<Palette size={32} />}
          title="UI/UX Design"
          description="Figma, Adobe XD, User Research, Prototyping"
        />

        <SkillCard
          icon={<Database size={32} />}
          title="Database Design"
          description="MySQL, PostgreSQL, MongoDB, Schema Design"
        />
      </div>
    </section>
  );
};

export default Skills;
